import React from 'react';

const Navbar = () => {
  return (
    <div className="flex justify-between items-center p-6 bg-blue-950 text-white font-bold text-2xl">
      <h1 className="text-3xl cursor-pointer hover:shadow-transparent hover:scale-110 translate-x-0 duration-200">Ecomzy</h1>
      <ul className="flex gap-6">
        <li className="cursor-pointer hover:scale-110 transition-transform duration-200 translate-x">Home</li>
        <li className="cursor-pointer hover:scale-110 transition-transform duration-200">Cart</li>
      </ul>
    </div>
  );
};

export default Navbar;
